import styled from 'styled-components';

export default styled.button`
	background-color: #47FFC4;
	border: 2px solid #67FFCF;
	color: white;
	font-size: 0.8em;
	font-weight: bold;
	padding: 5px 10px 5px 10px;
	height: auto;
	border-radius: 5px;
	margin-top: auto; margin-bottom: auto;

	&:hover {
		background-color: #00FFA3;
	}
`;
